var mondayFights = filterFights();

function filterFights() {
  jouzoleanAndBebulsTournaments.sort(function(a,b){
    let x = a.startsAt;
    let y = b.startsAt;
    if (x < y) {return -1;}
    if (x > y) {return 1;}
    return 0;
  });

  let filtered = [];
  jouzoleanAndBebulsTournaments.forEach(fight => {
    if (playersCountWhoPlayed(fight)>3 && fight.fullName.toLowerCase().includes("fight")) filtered.push(fight);
  })
  return filtered;
}

function addTournaments(downloadedTournaments) {
  jouzoleanAndBebulsTournaments = jouzoleanAndBebulsTournaments.concat(downloadedTournaments)
  mondayFights = filterFights()
}
